const bel = require('bel')
module.exports = transfer

function transfer(protocol) {
    const sender = protocol( get )

    const transferElement = bel`
    <div class="form-field" data-action="transfer" aria-label="Transfer">
        <div class="row">
            <label for="avatar">
            <img role="img" class="avatar" alt="avatar" name="avatar" aria-label="avatar" src="data:image/svg+xml;base64,"></label>
        </div>
    </div>
    `

    return transferElement
    function get (msg) {
        console.log(msg);
    }
}